import React from 'react';
import { Link, Route } from 'react-router-dom';
import ShowCheck from './ShowCheck';
import TicketManagement from './TicketManagement';

const ManagementMenu = ({match}) => {
    return (
        <div>
           <ul>
                <li><Link to={`${match.url}/TicketManagement`}>예매관리</Link></li>
                <li><Link to={`${match.url}/ShowCheck`}>검표</Link></li>
                <li><Link to={`${match.url}/ReviewManagement`}>리뷰관리</Link></li>
                <li><Link to={`${match.url}/4`}>극장관리</Link></li>
           </ul>
           <Route exact path={match.url} render={()=>(<h3>원하는 메뉴를 눌러주세요</h3>)}/>
           <Route path={`${match.url}/:TicketManagement`} component={TicketManagementketManagement}/>
           <Route path={`${match.url}/:ShowCheck`} component={ShowCheck}/>
           <Route path={`${match.url}/:ReviewManagement`} component={ManagementMenu}/>
           <Route path={`${match.url}/:4`} component={TicketManagement}/>
           
        </div>
    );
};

export default ManagementMenu;
